import React from 'react';
import 'bootstrap';
import axios from 'axios';
import './App.css';
import { Link } from 'react-router-dom';

class ModeSwitcher extends React.Component {
	render() {
		return  <div className='row'>
					<div className='col-6'>
						<Link to={{pathname: `/working/${this.props.projectId}`}}>Working</Link>
					</div>
					<div className='col-6'>
						<Link to={{pathname: `/planning/${this.props.projectId}`}}>Working</Link>
					</div>
				</div>
	}
}

export default ModeSwitcher
